css:
@-moz-document domain(rbxcash.com)
{
/*-------------------- Wallpaper --------------------*/

  body
  {
    background: no-repeat center/100% url( "https://img10.deviantart.net/9837/i/2016/335/5/1/_wallpaper__juuzou__by_ellioun-daq8wk7.png");
  }

/*-------------------- Login "WallP..." --------------------*/

  .backgroundImage.blur.absolute
  {
    background-image: url("https://uploaddeimagens.com.br/images/001/653/790/full/fb98097639f8aa18dad32213481aa058.jpg?1538685378") !important;
  }

/*-------------------- Text-Color --------------------*/
    
  #totalOffersDisplay.odometer, .total h2, #totalRobuxDisplay.odometer, .categoryTitle p, .categoryTitle
  {
    color: var(--text-color-first, #FFFFFF);
  }

  .challengesWrapper, .rewardsWrapper
  {
    color: var(--text-color-first, #CDCDCD);
  }

  .contentBody h4
  {
    color: var(--text-color-first, #FFFFFF);
  }

/*-------------------- Other --------------------*/

  .sidenav, .banner, .largeBox.secondaryBox, .largeBox.mainBox, .featuredOffer, .offerWallItem, .login
  {
    background-color: rgba(0, 0, 0, 0.5);
  }

  .accountButton
  {
    background-color: rgba(315, 314, 313, 0.7);
  }

  .frozen, .bonusBar, .headersWrapper
  {
    background-color: rgba(0, 0, 0, 1);
  }

  #robloxAccountInput
  {
    background-color: rgba(315, 314, 313, 0.2);
  }

  #giveawayButton.giveawayButton.cursor.giveawayButtonEntered
  {
    background-color: rgba(0, 0, 0, 1.6);
  }

  #smores1.videoItem, #smores2.videoItem, #smores3.videoItem, #smores4.videoItem
  {
    background-color: rgba(0, 0, 0, 0.5);
  }

  #engageScienceTile.videoItem, #engageHealthTile.videoItem, #engageTravelTile.videoItem, #engageSportsTile.videoItem, #twitterTile.bonusItem, 
    #discordTile.bonusItem
  {
    background-color: rgba(0, 0, 0, 0.5);
  }

  .trending
  {
    box-shadow: 0 0 22px rgba(255, 255, 255, .7)!important;
  }

  .featuredOffer
  {
    box-shadow: 0 0 22px rgba(255, 255, 255, .7)!important;
  }

  #ptcwallTile
  {
    box-shadow: 0 0 22px rgba(255, 255, 255, .7)!important;
  }

  .withdrawItem
  {
    background-color: rgba(253, 49, 49, 0.5);
    box-shadow: 0 0 40px rgba(253, 49, 49, 0.5)!important;
  }

  .withdrawDisabled
  {
    box-shadow: 0 0 40px rgba(132, 132, 130, 0.7)!important;
    background-color: rgba(132, 132, 132, .6)!important;
  }

  .xpDisplay .bar
  {
    background-color: rgba(0, 0, 0, 0.4);
  }

  .largeBox input
  {
    border: 2px solid rgba(255, 255, 255, 1);
    color: #F3F3F3;
  }

  .challengeItemInformation .bar, .challengeComplete
  {
    background-color: rgba(0, 0, 0, 0.7)!important;
  }

  .rewardsItem
  {
    border: 2px solid rgba(255, 255, 255, 1);
  }

  .largeBox
  {
    border: 2px solid #F3F3F3;
  }

  .smallBox
  {
    border: 2px solid #F3F3F3;
    background-color: rgba(0, 0, 0, 0.5);
  }

  .faqTabs li
  {
    border: 2px solid #F3F3F3;
    background-color: rgba(0, 0, 0, 0.5);
  }

/*-------------------- Fixes --------------------*/

  #vpnWarning
  {
    color: var(--text-color-first, #FFFFFF);
    background-color: #000000;
  }

  .vpnWarning
  {
    border: 1px solid #000000;
  }

  .topnav
  {
    background-color: #000000;
    border: 5px solid #000000;
  }

  .frozen
  {
    border: 5px solid #ff0a01;
    color: #ff0a01;
  }

  #tos li, #tos p, .tosTitle, #privacy p, #privacy li
  {
    color: var(--text-color-first, #B6B7B6)!important;
  }

  #privacy .box h3, #tos .box h3, .contentBody .title
  {
    color: var(--text-color-first, #FFFFFF)!important;
  }

  .topnav::after
  {
    width: 9%;
    content: "";
    position: absolute;
    color: #F3F3F3;
    margin-top: 10px;
    top: -1%;
    left: 1550px;
    font-size: 20px;
    font-family: monospace;
  }
}
